<template>
    <div class="windows-all" ref="windowAllRef"></div>
    <div class="windows-hind" ref="windowHindRef">
        <img
            src="data:image/png;base64,"
            alt=""
        />
    </div>
</template>

<script lang="ts">
import { browserInfo } from "@/utils/tools";
import { defineComponent, ref } from "vue";
// @ is an alias to /src
export default defineComponent({
    setup() {
        const windowAllRef = ref();
        const windowHindRef = ref();

        const openApp = () => {
            if (browserInfo.versions.mobile) {
                //判断是否是移动设备打开。
                let ua = navigator.userAgent.toLowerCase() as any; //获取判断用的对象
                if (
                    ua.match(/MicroMessenger/i) == "micromessenger" ||
                    ua.match(/WeiBo/i) == "weibo" ||
                    ua.match(/ QQ/i) == " qq"
                ) {
                    //在微信、微博、QQ中打开
                    windowAllRef.value.style.display = "block";
                    windowHindRef.value.style.display = "block";
                } else if (
                    browserInfo.versions.ios ||
                    browserInfo.versions.android
                ) {
                    const btn = document.getElementById("openapp") as any;
                    btn.href = `fu://ptag/preview?avatarId=${query.avatarid}`;
                } else {
                    // 其他第三方
                    windowAllRef.value.style.display = "block";
                    windowHindRef.value.style.display = "block";
                }
            } else {
                //否则就是PC浏览器打开
                alert("请用手机打开");
            }
        };

        return {};
    },
});
</script>
<style lang="scss">
.windows-all {
    position: fixed;
    left: 0;
    right: 0;
    top: 0;
    bottom: 0;
    background-color: #000;
    opacity: 0.5;
    display: none;
}
.windows-hind {
    position: fixed;
    right: 0;
    top: 0;
    text-align: right;
    padding-top: 16px;
    padding-right: 16px;
    display: none;
    img {
        width: 200px;
    }
}
</style>
